import React, {Component} from "react";
import '../css/GettingStarted.css'

class GettingStarted extends Component{
    render(){
        return(
        <div className="gs container-fluid">
            <p className="gsHead">Getting started with<br/>Foresight App</p>
            <div className="steps">
                <div className="step1">
                    <div className="stepImageDiv1">
                        <hr></hr>
                        <img className=""></img>
                    </div>
                </div>
                <div className="step2"></div>
                <div className="step3"></div>
                <div className="step4"></div>
            </div>
        </div>
        );
    }
}

export default GettingStarted;
